import React, { useState } from 'react';
import './App.scss';

const App = () => {
  return (
    <div className="app">
      <div className='appChildContainer'>
        <div className='headerContainer'>
          <h1>TodoList</h1>
        </div>
      </div>
    </div>
  );
}

export default App;
